" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 554px\">",
"   <div class=\"ttl\">",
"    A 22 year old woman with moyamoya disease and sudden severe headache",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 534px; height: 225px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Non-contrast CT scan of the brain reveals blood in the frontal and occipital horns of the left lateral ventricle (white arrows).",
"    <br>",
"     (B) Cerebral angiogram (lateral projection) demonstrates total occlusion of the left internal carotid artery and collateral flow from the external carotid system.",
"     <br>",
"      (C) Selective angiogram shows severe stenosis of the distal part of the right internal carotid artery. Note the collateral vascular networks around the stenotic area (black arrows).",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       Courtesy of Nijasri Suwanwela, MD.",
"      </div>",
