var title_f8_51_9014="Seldinger technique";
var content_f8_51_9014=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F71771&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F71771&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 562px\">",
"   <div class=\"ttl\">",
"    Seldinger technique for central venous access",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 542px; height: 450px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A) The needle, attached to a syringe, is inserted into the femoral vein. Once the needle is through the skin, the plunger of the syringe is gently pulled back. The needle is in the vessel when blood flows freely into the syringe. B) The syringe is removed and the flexible end of the guidewire is inserted through the needle into the vessel. C) The needle is removed, leaving the guidewire in place. The catheter is advanced with a twisting motion over the guidewire into the vessel. The guidewire is then removed as the catheter is held in place. D) The catheter should flush easily with fluid.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
