"   <div class=\"block mop drugH1Div\" id=\"F204963\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Monitor for pain relief, respiratory and mental status, blood pressure, constipation",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F6038714\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Percocet-5 (IL);",
"     </li>",
"     <li>",
"      Tylenol Oxy (KP)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F204952\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Oxycodone, as with other narcotic (opiate) analgesics, blocks pain perception in the cerebral cortex by binding to specific receptor molecules (opiate receptors) within the neuronal membranes of synapses. This binding results in a decreased synaptic chemical transmission throughout the CNS thus inhibiting the flow of pain sensations into the higher centers. Mu and kappa are the two subtypes of the opiate receptor to which oxycodone binds to cause analgesia.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Acetaminophen inhibits the synthesis of prostaglandins in the CNS and peripherally blocks pain impulse generation; produces antipyresis from inhibition of hypothalamic heat-regulating center.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F204970\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     See individual agents.",
"    </p>",
"   </div>",
