var title_f8_51_9020="Medical screening by BMI category";
var content_f8_51_9020=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F52069&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F52069&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Medical screening for children with obesity, by BMI category",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"2\" width=\"20%\">",
"     </colgroup>",
"     <colgroup width=\"60%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        BMI percentile",
"       </td>",
"       <td class=\"subtitle1\">",
"        Physical examination",
"       </td>",
"       <td class=\"subtitle1\">",
"        Laboratory tests",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        85th-94th percentile",
"       </td>",
"       <td rowspan=\"2\">",
"        Blood pressure, full exam",
"       </td>",
"       <td>",
"        Fasting lipid profile*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Conditional testing for abnormalities in blood glucose or liver function",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        &ge;95th percentile",
"       </td>",
"       <td rowspan=\"3\">",
"        Blood pressure, full exam",
"       </td>",
"       <td>",
"        Fasting lipid profile*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hemoglobin A1c or fasting glucose level every two years",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        ALT and AST levels every two years",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * If results of the fasting lipid profile are normal, we suggest repeating the screening every three to five years. If the results are abnormal, annual monitoring usually is appropriate. (Refer to UpToDate topic on Pediatric prevention of adult cardiovascular disease).",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     In this weight category, screening for abnormalities in blood glucose or hemoglobin A1c, AST and ALT is recommended if the patient is 10 years or older, and has one or more of the following risk factors: personal history of elevated blood pressure, lipid levels, tobacco use, or family history of obesity-related diseases (type 2 diabetes, lipid abnormalities, heart disease).",
"     <br/>",
"     &Delta; Hemoglobin A1c is now an accepted approach to screening for diabetes mellitus in adults; a hemoglobin A1c level &ge;6.5 percent on two occasions can be used to diagnose diabetes, and patients with A1c values between 5.7 and 6.4 percent are at high risk for developing diabetes. The utility of hemoglobin A1c as a screening tool in children and adolescents has not been fully evaluated.",
"    </div>",
"    <div class=\"reference\">",
"     Recommendations based on: Krebs NF. Assessment of child and adolescent overweight and obesity. Pediatrics 2007; 120:S193.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
