var title_f8_51_9022="Rhythm versus rate control AF RACE";
var content_f8_51_9022=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F74434&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F74434&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 479px\">",
"   <div class=\"ttl\">",
"    Rate control versus rhythm control in RACE",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 459px; height: 341px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Results of the RACE trial in which 522 patients with recurrent persistent atrial fibrillation (AF) were randomly assigned to rhythm or rate control. The primary end point was a composite of cardiovascular death, heart failure, thromboembolism, bleeding, pacemaker placement, and antiarrhythmic drug side effects. There was an almost significant trend toward a lower incidence of the primary end point with rate control (17.2 versus 22.6 percent with rhythm control, hazard ratio 0.73, 90 percent CI 0.53 to 1.01).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Van Gelder IC, Hagens VE, Bosker HA, et al. N Engl J Med 2002; 347:1834.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
