"    Hemoglobin electrophoresis (alkaline pH)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 501px; height: 355px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This is an example of hemoglobin electrophoresis run at alkaline pH on cellulose acetate. The electrophoretic positions of the more common hemoglobins are shown on the right.",
"    <br>",
"     Lane 1 is a commercial standard containing approximately equal amounts of hemoglobins A, F, S, and C.",
"     <br>",
"      Lanes 2, 3, 4, 6, 8, and 10 are from normal subjects (Hb A only).",
"      <br>",
"       Lanes 7 and 9 are from subjects with sickle cell trait (Hbs A and S).",
"       <br>",
"        Lane 5 is from a subject with homozygous sickle cell anemia (Hbs F and S).",
"        <br>",
"         Lane 11 is from a subject with hemoglobin SC disease (Hbs S and C).",
"         <div class=\"footnotes\">",
"         </div>",
"         <div class=\"reference\">",
"          Electrophoretogram kindly supplied by Dr. Radek Bieniek, Beth Israel Deaconess Medical Center, Boston, MA.",
"         </div>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
